"use client";

import React, { useState } from "react";
import { jsPDF } from "jspdf";
import "jspdf-autotable";
import SalesBarChart from "../components/SalesBarChart";
import SalesSummary from "../components/SalesSummary";
import SalesDetails from "../components/SalesDetails";
import SalesToday from "../components/SalesToday";
import { SaleProps } from "../Types";
import { UserOptions } from "jspdf-autotable";

// Extend jsPDF to include the autoTable method with the correct type
declare module "jspdf" {
  interface jsPDF {
    autoTable: (options: UserOptions) => jsPDF;
  }
}

const Sales = () => {
  const [sales, setSales] = useState<SaleProps>({
    yesterdaySales: 0,
    todaySales: 0,
    yesterdayOrders: 0,
    todayOrders: 0,
    yesterdayProductsSold: 0,
    todayProductsSold: 0,
    lastWeekSales: 0,
    thisWeekSales: 0,
    lastMonthSales: 0,
    thisMonthSales: 0,
    lastYearSales: 0,
    thisYearSales: 0,
    totalSales: 0,
    totalProducts: 0,
    totalOrders: 0,
  });

  const generateReportForPeriod = (period: string) => {
    const doc = new jsPDF();

    doc.setFont("helvetica", "normal");
    doc.setFontSize(22);

    const getValue = (value: number | undefined | null): string =>
      value !== undefined && value !== null ? String(value) : "-";

    const bodyContent =
      period === "Sales"
        ? [
            ["Today Sales", getValue(sales.todaySales)],
            ["Yesterday Sales", getValue(sales.yesterdaySales)],
            ["This Week Sales", getValue(sales.thisWeekSales)],
            ["Last Week Sales", getValue(sales.lastWeekSales)],
            ["This Month Sales", getValue(sales.thisMonthSales)],
            ["Last Month Sales", getValue(sales.lastMonthSales)],
            ["This Year Sales", getValue(sales.thisYearSales)],
            ["Last Year Sales", getValue(sales.lastYearSales)],
            ["Total Sales", getValue(sales.totalSales)],
            ["Total Orders", getValue(sales.totalOrders)],
            ["Total Product Sold", getValue(sales.totalProducts)],
          ]
        : [["-", "-"]];

    doc.autoTable({
      head: [["Title", "Value"]],
      body: bodyContent,
      startY: 60,
      styles: {
        font: "helvetica",
        fontSize: 12,
        lineColor: [220, 220, 220],
        lineWidth: 0.5,
        fillColor: [255, 255, 255],
        textColor: [50, 50, 50],
        halign: "center",
        valign: "middle",
        cellPadding: { top: 8, right: 12, bottom: 8, left: 12 },
        overflow: "linebreak",
      },
      headStyles: {
        fillColor: [195, 176, 145],
        textColor: [255, 255, 255],
        fontStyle: "bold",
      },
      alternateRowStyles: {
        fillColor: [245, 245, 250],
      },
      columnStyles: {
        0: { halign: "left", cellPadding: { left: 29 } },
        1: { halign: "right", cellPadding: { right: 29 } },
      },
      margin: { top: 60, left: 20, right: 20 },
      tableWidth: "auto",
      didDrawPage: (data) => {
        const pageWidth = doc.internal.pageSize.getWidth();
        const pageHeight = doc.internal.pageSize.getHeight();
        const marginLeft = data.settings.margin.left;

        // Add header with logo
        const logoBase64 =
          "data:image/png;base64,"; // Replace with your Base64-encoded image or URL
        const logoWidth = 30; // Adjust width
        const logoHeight = 30; // Adjust height
        const logoX = marginLeft;
        const logoY = 15;

        doc.addImage(logoBase64, "PNG", logoX, logoY, logoWidth, logoHeight);

        // Title text next to the logo
        const titleX = logoX + logoWidth + 5; // Adjust spacing between logo and title
        const titleY = logoY + 10; // Center the title with the logo vertically
        doc.setFont("helvetica", "bold");
        doc.setFontSize(20);
        doc.setTextColor(34, 94, 168);
        doc.text("Taplokal Sales Report", titleX, titleY);

        // Sub-header line
        doc.setDrawColor(220, 220, 220);
        doc.setLineWidth(0.5);
        doc.line(marginLeft, 50, pageWidth - marginLeft, 50);

        // Footer
        doc.setFont("helvetica", "italic");
        doc.setFontSize(10);
        doc.setTextColor(120, 120, 120);

        const currentPage = doc.internal.pages.length - 1;
        const totalPages = doc.internal.pages.length - 1;

        doc.text(
          `Generated on: ${new Date().toLocaleDateString()} | Page ${currentPage} of ${totalPages}`,
          pageWidth - marginLeft - 50,
          pageHeight - 10,
          { align: "right" }
        );
      },
    });

    doc.save(`taplokal_${period.toLowerCase()}_report.pdf`);
  };

  return (
    <div className="w-full flex flex-col gap-8 px-4 lg:px-12">
      <div className="lg:flex lg:gap-12 lg:mb-10">
        <div className="lg:w-3/4 w-full">
          <h1 className="text-3xl font-semibold mb-6">Sales</h1>
          <SalesBarChart setSales={setSales} />
        </div>
        <div className="lg:w-1/3 w-full flex flex-col gap-6">
          <h1 className="text-3xl font-semibold mb-6">Details</h1>
          <SalesDetails sales={sales} />
          {["Sales"].map((period) => (
            <button
              key={period}
              onClick={() => generateReportForPeriod(period)}
              className="py-3 px-6 rounded-full w-full sm:w-auto transition-transform transform hover:scale-105 text-white font-medium shadow-md bg-foreground hover:bg-foreground focus:outline-none "
              aria-label={`${period} Sales Report`}
            >
              Download {period} Report
            </button>
          ))}
        </div>
      </div>

      <div className="lg:flex lg:gap-12">
        <div className="lg:w-1/2 w-full px-6 py-8 border-2 border-foreground/30 rounded-2xl mb-6 lg:mb-0">
          <SalesSummary sales={sales} />
        </div>
        <div className="lg:w-1/2 w-full p-6 bg-foreground/30 rounded-2xl">
          <h1 className="text-2xl font-bold mb-4">Today&apos;s Sales</h1>
          <p className="mb-4">Sales Summary</p>
          <SalesToday sales={sales} />
        </div>
      </div>
    </div>
  );
};

export default Sales;
